int flam3_get_palette(int n, flam3_palette c, double hue_rotation)
{
   int cmap_len = 256;
   int i, j;
   if (flam3_palette_random == n)
      n = random();
   if (n < 0) n = 0;
   n = n % vlen(the_cmaps);
   for (i = 0; i < cmap_len; i++) {
      int ii = (i * 256) / cmap_len;
      double rgb[3], hsv[3];
      for (j = 0; j < 3; j++)
	  rgb[j] = the_cmaps[n][ii][j] / 255.0;
      rgb2hsv(rgb, hsv);
      hsv[0] += hue_rotation * 6.0;
      hsv2rgb(hsv, rgb);
      for (j = 0; j < 3; j++)
	 c[i][j] = rgb[j];
   }
   return n;
}

/* rgb 0 - 1,
   h 0 - 6, s 0 - 1, v 0 - 1 */
void rgb2hsv(rgb, hsv)
   double *rgb; double *hsv;
 {
  double rd, gd, bd, h, s, v, max, min, del, rc, gc, bc;

  rd = rgb[0];
  gd = rgb[1];
  bd = rgb[2];

  /* compute maximum of rd,gd,bd */
  if (rd>=gd) { if (rd>=bd) max = rd;  else max = bd; }
         else { if (gd>=bd) max = gd;  else max = bd; }

  /* compute minimum of rd,gd,bd */
  if (rd<=gd) { if (rd<=bd) min = rd;  else min = bd; }
         else { if (gd<=bd) min = gd;  else min = bd; }

  del = max - min;
  v = max;
  if (max != 0.0) s = (del) / max;
             else s = 0.0;

  h = 0;
  if (s != 0.0) {
    rc = (max - rd) / del;
    gc = (max - gd) / del;
    bc = (max - bd) / del;

    if      (rd==max) h = bc - gc;
    else if (gd==max) h = 2 + rc - bc;
    else if (bd==max) h = 4 + gc - rc;

    if (h<0) h += 6;
  }

  hsv[0] = h;
  hsv[1] = s;
  hsv[2] = v;
}


/* h 0 - 6, s 0 - 1, v 0 - 1
   rgb 0 - 1 */
void hsv2rgb(hsv, rgb)
   double *hsv;
   double *rgb;
{
   double h = hsv[0], s = hsv[1], v = hsv[2];
  int    j;
  double rd, gd, bd;
  double f, p, q, t;

   while (h >= 6.0) h = h - 6.0;
   while (h <  0.0) h = h + 6.0;
   j = (int) floor(h);
   f = h - j;
   p = v * (1-s);
   q = v * (1 - (s*f));
   t = v * (1 - (s*(1 - f)));
   
   switch (j) {
    case 0:  rd = v;  gd = t;  bd = p;  break;
    case 1:  rd = q;  gd = v;  bd = p;  break;
    case 2:  rd = p;  gd = v;  bd = t;  break;
    case 3:  rd = p;  gd = q;  bd = v;  break;
    case 4:  rd = t;  gd = p;  bd = v;  break;
    case 5:  rd = v;  gd = p;  bd = q;  break;
    default: rd = v;  gd = t;  bd = p;  break;
   }

   rgb[0] = rd;
   rgb[1] = gd;
   rgb[2] = bd;
}

void
cmap2image(n, f)
   int n;
   FILE *f;
{
   int i;

   fprintf(f, "P3\n16 16\n# cmap %d\n255\n", n);
   for (i = 0; i < 256; i++)
      fprintf(f, "%d %d %d ",
	      the_cmaps[n][i][0],
	      the_cmaps[n][i][1],
	      the_cmaps[n][i][2]);
   fprintf(f, "\n");
}
   
void
cmap2image2(n, f)
   int n;
   FILE *f;
{
   int i, j;

   fprintf(f, "P3\n50 256\n# cmap %d\n255\n", n);
   for (i = 0; i < 256; i++)
       for (j = 0; j < 50; j++)
	   fprintf(f, "%d %d %d ",
		   the_cmaps[n][i][0],
		   the_cmaps[n][i][1],
		   the_cmaps[n][i][2]);
   fprintf(f, "\n");
}
   

